This is a Color Minimal Theme for GO Locker.

Make sure to check out my matching Go SMS Pro &amp; Go Contacts Color Minimal themes!
This is NOT a standalone app, so download Go Launcher Ex &amp; Go Locker in the market if you haven't already done so.
Installation
1. Install GO Locker &amp; Go Launcher Ex (both free &amp; available in the Market)
2. Install this theme
3. Menu -&gt; Plugins tab -&gt; Go Locker -&gt; Color Minimal
